        }
        return result && result.slice(0, 50);
    }
    constructor(street) {
        if (!Street.isValid(`${street}`)) {
            throw new Error('Невозможно создать улицу. Формат не верен.');
        }
        this._value = `${street}`;
    }
    clone() {
        return new Street(this.value);
    }
